import React, { useEffect, useState } from "react";

function HistoryPage() {
  const [history, setHistory] = useState([]);

  useEffect(() => {
    const saved = JSON.parse(localStorage.getItem("predictionHistory")) || [];
    setHistory(saved);
  }, []);

  return (
    <div style={{ maxWidth: "800px", margin: "50px auto", padding: "20px" }}>
      <h2>ðŸ“Š Prediction History</h2>

      {history.length === 0 ? (
        <p>No predictions yet. Go to the Predict Yield page and submit a form!</p>
      ) : (
        <table style={{ width: "100%", borderCollapse: "collapse" }}>
          <thead>
            <tr style={{ backgroundColor: "#eee" }}>
              <th style={thStyle}>Crop</th>
              <th style={thStyle}>Soil pH</th>
              <th style={thStyle}>Rainfall</th>
              <th style={thStyle}>Temperature</th>
              <th style={thStyle}>Predicted Yield</th>
            </tr>
          </thead>
          <tbody>
            {history.map((item, index) => (
              <tr key={index}>
                <td style={tdStyle}>{item.Crop}</td>
                <td style={tdStyle}>{item.Soil_pH}</td>
                <td style={tdStyle}>{item.Rainfall}</td>
                <td style={tdStyle}>{item.Avg_Temperature}</td>
                <td style={tdStyle}>{item.predicted_yield}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

const thStyle = { border: "1px solid #ccc", padding: "8px", textAlign: "center" };
const tdStyle = { border: "1px solid #ccc", padding: "8px", textAlign: "center" };

export default HistoryPage;
